import React from 'react';
import "../Myform/Myform.scss";
import Button from '../../Components/Buttons/Button';


export default function Myform() {
  return (
    <div className='container-fluid upload_container'>
        <h1>PROJECT UPLOADER</h1>
        <div className='container inner_upload_container'>
        <form action="">
            <input type="text" placeholder='Project Name' className='form-control'/>
            <input type="text" placeholder='Project Status' className='form-control'/>
            <input type="text" placeholder='Project year' className="form-control"/>
            <input type="text" className='form-control'/>
            <label htmlFor="imageupload"><button>Upload</button></label>
            <input type="file" name='imageupload' className='form-control' style={{display: "none"}}/>
            <input type="text" className='form-control'/>
            <Button title={"Send"} styLe="blue"/>
        </form>
        </div>
    </div>
  )
}
